import styled from 'styled-components'

export const StyledDiv = styled.div`
    height: 100vh; 
    display: flex; 
    flex-direction: column; 
    justify-content: center; 
    align-items: center; 
    font-size: 1.5rem;

    h1{
        font-weight: 900; 
        margin-bottom: 10px;
    } 

`
